import React, { useState } from 'react'
import PostList from './components/PostList'
import './styles/index.css'


function App() {



  const [posts, setPosts] = useState([
    { id: 1, title: "Javascript 1", body: "Description" },
    { id: 2, title: "Javascript 2", body: "Description" },
    { id: 3, title: "Javascript 3", body: "Description" },
    { id: 4, title: "Javascript 4", body: "Description" },
  ]);

  const [posts1, setPosts1] = useState([
    { id: 1, title: "Python 1", body: "Description" },
    { id: 2, title: "Python 2", body: "Description" },
    { id: 3, title: "python 3", body: "Description" },
    { id: 4, title: "python 4", body: "Description" },
  ]);

  const [posts3, setPosts3] = useState([
    { id: 1, title: "C++ 1", body: "Description" },
    { id: 2, title: "C++ 2", body: "Description" },
    { id: 3, title: "C++ 3", body: "Description" },
    { id: 4, title: "p 4", body: "Description" },
  ]);

  return (
    <div className="App">
      <PostList posts={posts} title = "Пост 1"/>
      <PostList posts={posts1} title = "Пост 2"/>
    </div>
  );

}

export default App;
